import React, {useState} from 'react';
import ObjectItem from "./Item/ObjectItem";

const Objects = () => {
    const object = {id: 1, name: 'Object1', description:"торт"};

    return (
        <div>
            <h1>
                Object page
            </h1>
            <h4>{object.name}</h4>
            <img/>
            <text>{object.description}</text>
        </div>
    );
};

export default Objects;
